import React from 'react';
import { useSelector } from 'react-redux';
import {
    YoutubeIconStyled,
    TwitterIconStyled,
    RedditIconStyled,
    AmazonIconStyled
} from './media-icon.styles';

const MediaIcon = () => {
    const { mediaPref } = useSelector(state => state.userReducer);
    switch (mediaPref) {
        case 'Youtube':
            return (
                <YoutubeIconStyled />
            )
        case 'Twitter':
            return (
                <TwitterIconStyled />
            )
        case 'Reddit':
            return (
                <RedditIconStyled />
            )
        case 'Youtube':
            return (
                <AmazonIconStyled />
            )
        default:
            return (
                <YoutubeIconStyled />
            )
    }
}

export default MediaIcon;
